import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { isEmpty } from "../utils/index";

import { getDemandsByParoisse, updateDemande } from "../../actions/demandes";

const DemandesBoard = () => {
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getDemandsByParoisse());
  }, [dispatch]);

  const demands = useSelector((state) => state.demands);
  return <div className="demandes-container">DemandesBoard</div>;
};

export default DemandesBoard;
